import React from 'react';
import Admin from "./pages/Admin";
import SignIn from './pages/Admin/SignIn';
import Home from './pages/Home';

import './App.scss';

function App() {
  return (
  <div>
    <h1>Estamos en App</h1>
    <Admin/>
    <SignIn/>
    <Home/>
  </div>
  );
}

export default App;
